import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

import image from './Images/25.jpeg';

class App extends Component {
  render() {
  return (
    <div>
      <p>Hello World!</p>
      <img src = {image} width = "400px" height = "400px"/>
    </div>
  );
}
}
export default App;
